import React from 'react';

// ==========================================
// INSTRUCCIONES PARA PONER TU LOGO PROPIO:
// ==========================================
// 1. Ten tu logo en formato PNG (preferiblemente con fondo transparente).
// 2. Conviértelo a Base64 usando una herramienta online (ej. https://www.base64-image.de/).
// 3. Borra todo el contenido dentro de las comillas invertidas `...` en la variable logoSrc de abajo.
// 4. Pega tu código Base64 (debe empezar con "data:image/png;base64,...").

// Por defecto, he diseñado un Isotipo "Z" hexagonal industrial usando SVG para que se vea bien mientras pones el tuyo.
const logoSrc = `data:image/png;base64,
`;

interface BrandLogoProps {
  className?: string;
  variant?: 'dark' | 'light'; // Useful if you have different logos for dark/light backgrounds
}

export const BrandLogo = ({ className = "h-10 w-10", variant = 'dark' }: BrandLogoProps) => {
  // Nota: Si tu logo real se ve muy pequeño o estirado, ajusta las clases CSS aquí.
  return (
    <img 
      src={logoSrc} 
      alt="ZELCON Logo" 
      className={`object-contain ${className}`}
    />
  );
};
